pragma solidity >=0.4.21 < 0.7.0;
pragma experimental ABIEncoderV2; 

contract POCAccessLogger {

    struct AccessTime {
        uint256 miningTime;
        uint256 accessTime;
    }
    
    mapping(string => AccessTime[]) accessLog; //map to hold last user's access time
    mapping(string => uint) accessLogCount;

    function set(string memory _user, uint256 _accessTime) public {
        accessLog[_user].push(AccessTime({
            miningTime: now,
            accessTime: _accessTime
        }));
        // accessLogCount[_user]++;
    }

    function getAll(string memory _user) public view returns (uint[] memory){
        uint[] memory accessTimes = new uint[](accessLog[_user].length);

        for(uint i = 0; i<accessLog[_user].length; i++) 
            accessTimes[i] = (accessLog[_user][i].accessTime);

        return accessTimes;
    }
    
    function getLast(string memory _user) public view returns (uint){
        return accessLog[_user][accessLog[_user].length-1].accessTime;
    }
}
